import React, { useRef, useState } from "react";
import NAvbsr from "./NAvbsr";
import EditLocationIcon from "@mui/icons-material/EditLocation";
import CallIcon from "@mui/icons-material/Call";
import AttachEmailIcon from "@mui/icons-material/AttachEmail";
import jsPDF from "jspdf";
import html2canvas from "html2canvas";
import "jspdf-security"; // ðŸ”’ import plugin

function Resume() {
  const resumeRef = useRef();
  const [pdfPassword, setPdfPassword] = useState("");

  const handleDownload = async () => {
    if (!pdfPassword) {
      alert("Please set a password for the PDF!");
      return;
    }

    const element = resumeRef.current;
    const canvas = await html2canvas(element, { scale: 2 });
    const imgData = canvas.toDataURL("image/png");

    const pdf = new jsPDF("p", "mm", "a4");
    const pageWidth = pdf.internal.pageSize.getWidth();
    const pageHeight = pdf.internal.pageSize.getHeight();

    const imgWidth = pageWidth;
    const imgHeight = (canvas.height * pageWidth) / canvas.width;

    let position = 0;

    if (imgHeight > pageHeight) {
      let heightLeft = imgHeight;
      while (heightLeft > 0) {
        pdf.addImage(imgData, "PNG", 0, position, imgWidth, imgHeight);
        heightLeft -= pageHeight;
        position -= pageHeight;
        if (heightLeft > 0) {
          pdf.addPage();
          position = 0;
        }
      }
    } else {
      pdf.addImage(imgData, "PNG", 0, 0, imgWidth, imgHeight);
    }

    // ðŸ”’ Apply password protection
    pdf.setEncryption({
      userPassword: pdfPassword, // password user enters
      ownerPassword: pdfPassword, // can also keep different owner password
      userPermissions: ["print", "modify", "copy", "annot-forms"], // allowed actions
    });

    pdf.save("Pritam_Muli_Resume.pdf");
  };

  return (
    <>
      <NAvbsr />

      {/* Password Input + Download Button */}
      <div className="text-center my-3">
        <input
          type="password"
          placeholder="Set PDF Password"
          value={pdfPassword}
          onChange={(e) => setPdfPassword(e.target.value)}
          className="form-control w-50 mx-auto mb-2"
